import NavTray from "./NavTray";
import NewThreadButton from "./NewThreadButton";
import ThreadsTray from "./ThreadsTray";

function Left(props) {
	return (
		<div className="left">
			<NewThreadButton
				threads={props.threads}
				setThreads={props.setThreads}
				selectedThread={props.selectedThread}
				setSelectedThread={props.setSelectedThread}
			/>

			<ThreadsTray
				threads={props.threads}
				setThreads={props.setThreads}
				selectedThread={props.selectedThread}
				setSelectedThread={props.setSelectedThread}
			/>

			<NavTray className="nav-tray" />
		</div>
	);
}

export default Left;
